st.markdown('''
Pero expliquemos brevemente que es el Sharpe Ratio: El Sharpe Ratio fue desarrollado por el Premio Nóbel William Sharpe de la Universidad de Stanford. 
Mide numéricamente la relación Rentabilidad / Volatilidad Histórica (desviación standard) de un Fondo de Inversión.
Se calcula dividiendo la rentabilidad de un fondo menos la tasa de interés sin riesgo entre la volatilidad o desviación standard de esa rentabilidad en el mismo periodo.''')
